const values = [
  {
    fixed: true,
    x: context.panel.chart.getWidth() / 2,
    y: context.panel.chart.getHeight() / 2,
    symbolSize: 20,
    id: '-1'
  }
];

const edges = [];

option = {
  series: [
    {
      type: 'graph',
      layout: 'force',
      animation: false,
      data: values,
      force: {
        // initLayout: 'circular'
        // gravity: 0
        repulsion: 100,
        edgeLength: 5
      },
      edges: edges
    }
  ]
};

setInterval(function () {
  if (values.length > 50) {
    return;
  }

  values.push({
    id: values.length + ''
  });
  var source = Math.round((values.length - 1) * Math.random());
  var target = Math.round((values.length - 1) * Math.random());
  if (source !== target) {
    edges.push({
      source: source,
      target: target
    });
  }
  context.panel.chart.setOption({
    series: [
      {
        roam: true,
        data: values,
        edges: edges
      }
    ]
  });
}, 200);

return option;

